// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "./IFactoryERC721.sol";
import "./BullTycoons.sol";
import "@openzeppelin/contracts/utils/Address.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";


contract BullTycoonsFactory is FactoryERC721, Ownable {
    using Strings for string;
    using Address for address;
    using SafeMath for uint256;

    event Transfer(
        address indexed from,
        address indexed to
    );

    address public proxyRegistryAddress;
    address public wethAddress = 0x7ceB23fD6bC0adD59E62ac25578270cFf1b9f619;
    address public nftAddress;
    string public baseURI = "https://gateway.pinata.cloud/ipfs/QmdLYK4BKcZr5epauNVd2ufj7UtnfgeaSwXsXedmGKddD7";
    bool public MINT_START = false;
    uint256 public MINT_START_DATE;

    /*
     * Enforce the existence of only 5000 BullTycoons .
     */
    uint256 TOTAL_BULL_SUPPLY = 5000;
    uint256 public MINT_PER_PERSON = 5;

    constructor(address _proxyRegistryAddress, address _nftAddress) {
        proxyRegistryAddress = _proxyRegistryAddress;
        nftAddress = _nftAddress;

        fireTransferEvents(address(0), owner());
        MINT_START_DATE = block.timestamp + 5 minutes;
    }

    function setMaxSupply(uint256 _maxSupply) public onlyOwner() {
        TOTAL_BULL_SUPPLY = _maxSupply;
    }

    function setMaxMintPerPerson(uint256 _maxMintPerPerson) public onlyOwner() {
        MINT_PER_PERSON = _maxMintPerPerson;
    }

    function getMaxSupply() public view returns (uint256) {
        return TOTAL_BULL_SUPPLY;
    }

    function name() override external pure returns (string memory) {
        return "BullTycoons Mint";
    }

    function symbol() override external pure returns (string memory) {
        return "BTS";
    }

    function supportsFactoryInterface() override public pure returns (bool) {
        return true;
    }

     function numOptions() override public view returns (uint256) {
        return MINT_PER_PERSON;
    }

    function transferOwnership(address newOwner) override public onlyOwner {
        address _prevOwner = owner();
        super.transferOwnership(newOwner);
        fireTransferEvents(_prevOwner, newOwner);
    }

    function transferNFTAdminRole(address newOwner) public onlyOwner {
        BullTycoons(nftAddress).transferOwnership(newOwner);
        fireTransferEvents(address(this), newOwner);
    }

    function fireTransferEvents(address _from, address _to) private {
        emit Transfer(_from, _to);
    }

    /* Presale Minting: Start */

    uint public PRESALE_AMOUNT = 5 * 10 ** 16; // Equivalent of 0.05 ETH
    mapping(address => bool) addressWhitelisted;
    mapping(address => uint256) addressToMints;
    modifier addressCanMint() {
        require(!address(msg.sender).isContract() && tx.origin == msg.sender, "Contracts cannot mint.");
        _;
    }

    modifier isMintable(uint256 _mintNumber) {
        // require(MINT_START, "Mint not started");
        require(block.timestamp >= MINT_START_DATE, "Mint not started");
        require((BullTycoons(nftAddress).totalSupply() + _mintNumber) <= TOTAL_BULL_SUPPLY, "Maximum mint reached");
        _;
    }

    // Admin funcions start --
    // set start minting to be true or false
    function setStartMinting(bool _startMinting) public onlyOwner() {
        MINT_START = _startMinting;
    }

    function setMintStartDate(uint256 _startDate) public onlyOwner() {
        MINT_START_DATE = _startDate;
    }

    // To be able to set weth address - just in case
    function setWethAddress(address _wethAddress) public onlyOwner() {
        wethAddress = _wethAddress;
    }

    // set minting price
    function setPresaleAmount(uint256 _presaleAmount) public onlyOwner() {
        PRESALE_AMOUNT = _presaleAmount;
    }

    // set whitelist addresses
    function setWhitelist(address[] memory _addresses) public onlyOwner() {
        for (uint256 i = 0; i < _addresses.length; i++) {
            addressWhitelisted[_addresses[i]] = true;
        }
    }

    // set bridge address
    function setBridgeAddress(address _bridgeAddress) public onlyOwner() {
        BullTycoons(nftAddress)._setBridgeAddress(_bridgeAddress);
    }

    // set base token URI
    function setBaseTokenUri(string memory _baseUri) public onlyOwner() {
        BullTycoons(nftAddress)._setBaseTokenURI(_baseUri);
    }

    // set contract URI
    function setContractUri(string memory _contractUri) public onlyOwner() {
        BullTycoons(nftAddress)._setContractURI(_contractUri);
    }
    // Admin functions done --

    // Whitelist start --

    function checkWhitelisted(address _address) public view returns(bool _isWhitelisted) {
        return addressWhitelisted[_address];
    }

    function whitelistMint() public isMintable(1) {
        require(addressWhitelisted[msg.sender], "Account not eligible to mint");
        BullTycoons bullTycoons = BullTycoons(nftAddress);
        bullTycoons.mintTo(msg.sender);
        addressWhitelisted[msg.sender] = false;
    }
    // Whitelist end --

    function presaleMint(uint256 _mintNumber) public isMintable(_mintNumber) addressCanMint() {
        uint256 mintCost = PRESALE_AMOUNT * _mintNumber;
        require(_mintNumber > 0, "Mint number should be one or more");
        require((addressToMints[msg.sender] + _mintNumber) <= MINT_PER_PERSON, "Max mint per address reached");
        require(IERC20(wethAddress).allowance(msg.sender, address(this)) >= mintCost, "Allowance not enough");
        BullTycoons bullTycoons = BullTycoons(nftAddress);
        IERC20(wethAddress).transferFrom(msg.sender, address(this), mintCost);
        for (uint256 i = 0; i < _mintNumber; i++ ) {
            bullTycoons.mintTo(msg.sender);
        }
        addressToMints[msg.sender] = addressToMints[msg.sender] + _mintNumber;
    }

    function getNumberMinted(address _minter) public view returns(uint256 numberMinted) {
        return addressToMints[_minter];
    }

    /* Presale Minting: End */

    /* ------------------------ Admin Withdrawal: Start ------------------------------ */
    function withdrawTokens(address[] memory tokenIds) public onlyOwner() {
        for (uint256 i = 0; i < tokenIds.length; i++) {
            IERC20 token = IERC20(tokenIds[i]);
            token.transfer(msg.sender, token.balanceOf(address(this)));
        }
    }
    /* ------------------------ Admin WithdrawWal: End ------------------------------ */

    function tokenURI(uint256 _optionId) override external view returns (string memory) {
        return string(abi.encodePacked(baseURI, Strings.toString(_optionId)));
    }
    /**
     * Hack to get things to work automatically on OpenSea.
     * Use isApprovedForAll so the frontend doesn't have to worry about different method names.
     */
    function isApprovedForAll(address _owner, address _operator)
        public
        view
        returns (bool)
    {
        if (owner() == _owner && _owner == _operator) {
            return true;
        }

        ProxyRegistry proxyRegistry = ProxyRegistry(proxyRegistryAddress);
        if (
            owner() == _owner &&
            address(proxyRegistry.proxies(_owner)) == _operator
        ) {
            return true;
        }

        return false;
    }

    /**
     * Hack to get things to work automatically on OpenSea.
     * Use isApprovedForAll so the frontend doesn't have to worry about different method names.
     */
    function ownerOf(uint256 _tokenId) public view returns (address _owner) {
        return owner();
    }
}
